import React, { Component } from 'react';

/*
* 
*/
class SearchResult extends Component {

	searchResultToExpandale() {

	}

	render() {
		if (this.props.search_result.length === 0) {
			return null; 
		}

		return (
		 <div>{this.searchResultToExpandale()}</div>
		);
	}
}

export default SearchResult;
